{"item_id":"d5a39123-a66f-43db-bb7a-871464c5e9d1","by":"Bill Gates","rating":null,"blurb":"Educated is even better than you’ve heard.\\nMelinda and I loved Tara Westover’s journey from the mountains of Idaho to the halls of Cambridge.\\n...\\nEducated is an amazing story, and I get why it’s spent so much time on the top of the New York Times bestseller list. \\n...\\nTara is never cruel, even when she’s writing about some of her father’s most fringe beliefs.\\n...\\nI found it fascinating how it took studying philosophy and history in school for Tara to trust her own perception of the world.\\n...\\nAlthough it’s not a political book, Educated touches on a number of the divides in our country: red states versus blue states, rural versus urban, college-educated versus not. \\n...\\nTara’s process of self-discovery is beautifully captured in Educated. It’s the kind of book that I think everyone will enjoy, no matter what genre you usually pick up. She’s a talented writer, and I suspect this book isn’t the last we’ll hear from her.","url":"https://www.gatesnotes.com/Books/Educated"}
{"item_id":"703ec80c-c9ae-4e53-bc8b-d5ca06faa7c7","by":"Bill Gates","rating":null,"blurb":"I couldn’t put down this thriller with a tragic ending.\\nThe inside story of the Theranos scandal is almost too wild to believe.\\n...\\nThe public didn’t know about Theranos’ deception until Carreyrou broke the story as a reporter at the Wall Street Journal. Because he was so integral to the company’s demise, Bad Blood offers a remarkable inside look.\\n\\nSome of the details he shares are—for lack of a better word—insane.\\n...\\nBad Blood is also a cautionary tale about the virtues of celebrity. On the surface, Holmes was everything Silicon Valley loves in a CEO: charismatic and convincing with a memorable personal story made for magazine profiles.\\n...\\nBad Blood tackles some serious ethical questions, but it is ultimately a thriller with a tragic ending. It’s a fun read full of bizarre details that will make you gasp out loud. The story almost feels too ridiculous to be real at points (no wonder Hollywood is already planning to turn it into a movie). I think it’s the perfect book to read by the fire this winter.","url":"https://www.gatesnotes.com/Books/Bad-Blood"}
