{"item_id":"52e0563e-87f3-4b15-b747-6f4c1b7629f7","by":"Bill Gates","rating":null,"blurb":"Lost and found with “the most wondrous map ever produced”. A talented writer and doctor guides us through the past, present, and future of genome science.\\n...\\nThe ethical questions around genome editing are enormous. That is why I am so glad I read The Gene by Columbia University cancer doctor and researcher Siddhartha Mukherjee. I loved Mukherjee’s 2015 TED Talk and his brilliant book about cancer, The Emperor of All Maladies, which won the Pulitzer Prize in 2011. It must really tick off full-time writers that a doctor can win a Pulitzer in his spare time!\\n...\\nIn The Gene, Mukherjee once again shows his gift for making hard science easily accessible. He wrote this book for general audiences, because he knows that it’s not good enough for scientists alone to debate the huge ethical questions that their discoveries provoke.\\n...\\nMy favorite part of the book was the final section, “Post-Genome: The Genetics of Fate and Future.” It does a great job bringing into sharp focus the difficult ethical questions that will become increasingly intense.","url":"https://www.gatesnotes.com/Books/The-Gene"}
{"item_id":"ee6b09a3-2903-4fcc-8caa-c30ff3b96d36","by":"Bill Gates","rating":null,"blurb":"I would say this even if I weren’t married to the author: The Moment of Lift is a terrific read.\\n\\nIt is a wise, honest, and beautifully written book about how empowering women lifts up everyone. (None of that will be surprising to anyone who knows Melinda.) Although it took her about a year to write, in a way she has been working on it her whole life. The Moment of Lift is about the women who have inspired Melinda, starting with her own mother, through her colleagues at Microsoft, and continuing today with the amazing scientists, farmers, educators, and leaders she meets through her work with our foundation. \\n...\\nBut to me, what is really impressive about the book is the way Melinda combines her mastery of data with her ability to tell powerful stories about individual women she has met.","url":"https://www.gatesnotes.com/Books/The-Moment-of-Lift"}
{"item_id":"b29b5383-f2f3-4e6d-9d35-aa0f33ea03c1","by":"Bill Gates","rating":null,"blurb":"What if people run out of things to do?\\nA provocative new book raises big questions about the future.\\nWhat gives our lives meaning? And what if one day, whatever gives us meaning went away—what would we do then?\\n\\nI’m still thinking about those weighty questions after finishing Homo Deus, the provocative new book by Yuval Noah Harari.\\n...\\nHarari’s new book is as challenging and readable as Sapiens. Rather than looking back, as Sapiens does, it looks to the future.\\n...\\nHere is Harari’s most provocative idea: As good as it sounds, achieving the dream of bliss, immortality, and divinity could be bad news for the human race.\\n...\\nHarari does the best job I have seen of explaining the purpose problem. And he deserves credit for venturing an answer to it. He suggests that finding a new purpose requires us to develop new religion.\\n...\\nI wasn’t satisfied by his answer to the purpose question. But don’t let a dissatisfying conclusion dissuade you from reading Homo Deus. It is a deeply engaging book with lots of stimulating ideas and not a lot of jargon. It makes you think about the future, which is another way of saying it makes you think about the present.","url":"https://www.gatesnotes.com/Books/Homo-Deus"}
